import React from 'react'
import {Image, Container, Row, Col, Jumbotron} from 'react-bootstrap';


export default class About extends React.Component{
    render(){
        return(
            <div> 
            &nbsp;

                <Jumbotron>
                <Col>
                <h1>About Me</h1>
                &nbsp;
                <p>Full-stack web developer with a passion for problem-solving. With experience in Ruby on Rails, JavaScript, and React I discovered web development while taking computer science classes and I fell in love with it. I bring strong skills in working with people, communication in English and Spanish as well as managing people. I spend my free time playing guitar as well as building small projects and learning about new technologies.</p>
                </Col>
                </Jumbotron>
            <Row>
            <Col xs={6} md={4}>
                <Image src="../assets/0.jpg/171x180" thumbnail/>
            </Col>
            </Row>


            </div>
        )
    }
}




